cssString:
div.ui-svg svg{
    color: var(--nr-dashboard-widgetColor);
    fill: currentColor !important;
}
div.ui-svg path {
    fill: inherit;
}

func:
var colorss;
var colorte;
var textoss;

//set global variable for start/stop
var toogle = context.get('toogle') || "false";

if (toogle == true){
    toogle = false;
    colorss = "#ff0000";
    colorte = "#ececec";
    textoss = "STOP";
}
else {
    toogle = true;
    colorss = "#00ff00";
    colorte = "#ff9800";
    textoss = "START";
}
context.set('toogle', toogle);

msg.payload = [
    {
        "command": "set_style",
        "selector": "#path3951",
        "attributeName": "fill",
        "attributeValue": colorss
    },
    {
        "command": "update_text",
        "selector": "#tspan2836-7",
        "textContent": textoss
    },
    {
        "command": "set_style",
        "selector": "#rect2988",
        "attributeName": "fill",
        "attributeValue": colorte
    },
    {
        "command": "update_text",
        "selector": "#tspan2836",
        "textContent": "30"
    }
    ];

return msg;

var flecha1;
var flecha2;
var flecha3;
var flechacc;

//set global variable for animar
var estado = context.get('animar') || 0;

switch (estado){
    case 0:
        flecha1 = "inline";
        flecha2 = "none";
        flecha3 = "none";
        flechacc = "#ffdd55";
        estado = 1;
    break;

    case 1:
        flecha1 = "none";
        flecha2 = "inline";
        flecha3 = "none";
        flechacc = "#666666";
        estado = 2;
    break;

    case 2:
        flecha1 = "none";
        flecha2 = "none";
        flecha3 = "inline";
        flechacc = "#d45500";
        estado = 0;
    break;
}
context.set('animar', estado);

msg.payload = [
    {
        "command": "set_style",
        "selector": "#path5806",
        "attributeName": "display",
        "attributeValue": flecha1
    },
    {
        "command": "set_style",
        "selector": "#path5806-5",
        "attributeName": "display",
        "attributeValue": flecha2
    },
    {
        "command": "set_style",
        "selector": "#path5806-6",
        "attributeName": "display",
        "attributeValue": flecha3
    },
    {
        "command": "set_style",
        "selector": "#path4577-3-4-7-1",
        "attributeName": "stroke",
        "attributeValue": flechacc
    }
    ];

return msg;

